class UiThreadExecutor : Executor {
    private val handler = Handler(Looper.getMainLooper())
    override fun execute(command: Runnable) {
        handler.post(command)
    }
}

class ListDataSource(private val items: List<NewsFeed>) : PositionalDataSource<NewsFeed>() {
    override fun loadInitial(params: LoadInitialParams, callback: LoadInitialCallback<NewsFeed>) {
        callback.onResult(items, 0, items.size)
    }

    override fun loadRange(params: LoadRangeParams, callback: LoadRangeCallback<NewsFeed>) {
        val start = params.startPosition
        val end = params.startPosition + params.loadSize
        callback.onResult(items.subList(start, end))
    }
}